import React, { Component } from "react";
import "../Components/Background/style.css";



class Leaderboard extends Component {

    render() {
        return (
            <div>
                <div className="background">
                    <h1>Leaderboard</h1>
                </div>
            </div>
        )
    }

}

export default Leaderboard;
